五十二甲國姓公廟，創建時間不詳，日治時期位址在羅東郡五結庄五十二甲205番地，今廟名為「五十二甲福興廟」，地址為五結鄉利澤西路34號；以國姓爺鄭成功為主神。基地面積249.39坪，建築面積7.11坪；祭祀圈包含五十二甲全部，例祭日未註明。其廟體建築為單開間，立於疊石台基之上，兩側牆體以紅磚砌築；正面採出屐起，以紅磚與木作構成，屋頂鋪以紅瓦。 　　根據五結庄役場1936（昭和11）年出版的《寺廟臺帳》，當時五結庄共有38處宗教建築，有37處是台灣傳統廟宇，1處日本神社（二結稻荷社）。其中，在利澤簡八大庄範圍內，則有14處台灣傳統廟宇。大多數廟宇今仍存，但規模、型態均與《寺廟臺帳》所呈現的樣貌不同。

